import React, { Component } from "react";
import Card from "./Card";

import App1 from "../../Assets/koga.jpg";
import App2 from "../../Assets/koga1.jpg";
import App3 from "../../Assets/koga2.jpg";
import App4 from "../../Assets/koga3.jpg";

class Cards extends Component {
  render() {
    return (
      <div className="container-fluid d-flex justify-content-center">
        <div className="row">
          <div className="col-md-3">
            <Card imgsrc={App4} title="App 4" />
          </div>
          <div className="col-md-3">
            <Card imgscr={App1} title="App 1" />
          </div>
          <div className="col-md-3">
            <Card imgscr={App2} title="App 2" />
          </div>
          <div className="col-md-3">
            <Card imgsrc={App3} title="App 3" />
          </div>
        </div>
      </div>
    );
  }
}

export default Cards;
